import React, { useState, useEffect } from 'react';
import { Route, Routes, Link, useNavigate } from 'react-router-dom';
import ProductList from './components/ProductList';
import Cart from './components/Cart';
import Login from './components/Login';
import { login } from './api';
import './App.css';

function App() {
  const [role, setRole] = useState(localStorage.getItem('role') || null);
  const [cart, setCart] = useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    if (role) {
      navigate('/home');
    }
  }, [role, navigate]);

  const handleLogin = async (username, password) => {
    try {
      const response = await login(username, password);
      if (response.error) {
        alert('Login Failed!');
      } else {
        setRole(response.role);
        localStorage.setItem('role', response.role); // Persist login state
        navigate('/home');
      }
    } catch (error) {
      alert('Error during login!');
    }
  };

  const handleLogout = () => {
    localStorage.removeItem('role');
    setRole(null);
    navigate('/');
  };

  const handleAddToCart = (product) => {
    setCart([...cart, product]);
  };

  const handleRemoveFromCart = (product) => {
    setCart(cart.filter(item => item.id !== product.id));
  };

  return (
    <div className="container-fluid">
      <div className="navbar navbar-expand-lg navbar-light bg-primary">
        <div className="container">
          <a className="navbar-brand" href="#">E-Toko Beras</a>
          <div className="d-flex justify-content-end">
            {role ? (
              <>
                <span className="text-white me-3">Welcome, {role}</span>
                <button onClick={handleLogout} style={{ background: 'none', border: 'none', color: '#007bff', textDecoration: 'underline', cursor: 'pointer' }}>
  Logout
</button>

              </>
            ) : (
              <Link to="/login" className="text-white">Login</Link>
            )}
          </div>
        </div>
      </div>

      <div className="d-flex">
        {/* Sidebar Navigation */}
        <nav className="sidebar">
          <ul className="nav">
            <li className="nav-item">
              <Link className="nav-link" to="/home">Home</Link>
            </li>
            <li className="nav-item">
              <Link className="nav-link" to="/cart">Keranjang</Link>
            </li>
            <li className="nav-item">
              <Link className="nav-link" to="/orders">Pesanan</Link>
            </li>
          </ul>
        </nav>

        {/* Main Content */}
        <div className="content">
          <Routes>
            <Route path="/login" element={<Login onLogin={handleLogin} />} />
            {role === 'pembeli' && (
              <>
                <Route path="/home" element={<ProductList onAddToCart={handleAddToCart} />} />
                <Route path="/cart" element={<Cart cart={cart} onRemoveFromCart={handleRemoveFromCart} />} />
              </>
            )}
            <Route path="/orders" element={<h1>Pesanan Anda</h1>} />
          </Routes>
        </div>
      </div>

      <footer className="footer bg-primary text-white text-center py-3">
        <p>&copy; 2024 E-Toko Beras. Semua Hak Dilindungi.</p>
      </footer>
    </div>
  );
}

export default App;
